Timezone: CET (+/- 3 hours)
 Requirements

 You have 5+ years of commercial experience in IT sphere; 
 You have 2+ years of experience with React Native; 
 You follow best practices and conventions; 
 Relevant experience in CI/CD and related tools; 
 Responsible and able to work with minimal supervision; 
 Upper-intermediate English level or higher; 
 You can communicate well with both technical and non-technical clients. 

Nice to have

 UI/UX design skills 
 Experience with .NET/AWS/Node.js 

What we offer

 100% remote work (work from where you want); 
 We pay for overtime (over 8 hours); 
 The ability to change the project to another one; 
 Competitive compensation and performance-based increases; 
 ‍️Very flexible working schedule; 
 Opportunities for professional development and personal growth; 
 If you're based in Kyiv and want to work from our office in the centre, you can come with your little friend. 

Co-founders

 Co-founder & CEO - Viktor Jarnheimer

 Co-founder & COO - Lee Haynes
 The company is founded by us - Viktor Jarnheimer and Lee Haynes. Our ultimate goal is to convince every Swedish company that we come across to work with devoted senior developers outside of Sweden.

Sweetspot is a booking platform and business insight system for the golf industry where we give the clubs unique knowledge about their own facility while we create the optimal experience for the golfer.
Together with players, clubs, coaches, and the whole golf industry we want to grow golf by doing the more accessible and attractive to all.
What we offer
Flexible remote work;
‍️24 paid vacation days;
Paid sick leaves;
‍️Business trips to Sweden at company expense (if and when necessary);
‍️Flexible working schedule;
Opportunities for professional development and personal growth;
Competitive monthly compensation;
Responsibilities
The main responsibility for the backend;
Integration of user-facing elements developed by front-end developers
Build efficient, testable, and reusable PHP modules
Solve complex performance problems and architectural challenges
Dealing with Laravel + Dingo API (legacy API) and Symfony (new API)
Collaborate with other team members and stakeholders.
Requirements
3+ years of Laravel/Symfony experience;
You follow best practices and conventions;
Responsible and able to work with minimal supervision;
Upper-intermediate English level or above;
You can communicate well with both technical and non-technical clients.
Nice-to-have
ElasticSearch experience.
Meet the team
