Timezone: CET (+/- 3 hours)
Proxify is a Swedish IT company, experiencing intense growth. We match remote IT professionals with companies in Sweden and abroad. The difference with us is that we like to make sure that the remote workers we present are the very best in their field. We like to make sure we get it the right first time, every time!
We are growing fast and are currently looking for a Senior Python Developer.
Proxify is partnering with a Swedish startup that is building its own trading platform for cryptocurrencies. Also, a company works with lead generation in gambling and finance.


We are building a team of the best Python developers. We currently have several Python projects soon starting. We are constantly looking for senior Python developers to join us on a remote basis.
Requirements
You have +3 years of experience with Python;
You have +2 years of experience with Kubernetes;
You follow best practices and conventions;
Relevant experience in CI/CD and related tools;
Responsible and able to work with minimal supervision;
Upper-intermediate English level;
You can communicate well with both technical and non-technical clients;

Nice-to-have:

Interest in cryptocurrency is a huge plus;
Timezone: CET (+/- 3 hours);

